import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import { Container } from '@mui/material';
import Login from './pages/login.jsx';
import MovieList from './pages/catalogo.jsx';
import Cadastro from './pages/cadastro.jsx';

function App() {
  const [isAdmin, setIsAdmin] = useState(false); // Aqui você deve definir a lógica para verificar se o usuário é admin

  return (
    <Router>
      <Container>
        <Routes>
          <Route path="/login" component={Login} />
          <Route path="/cadastro" component={Cadastro} />
          <Route 
            path="/filmes" 
            element={isAdmin ? <MovieList isAdmin={isAdmin} /> : <Navigate to="/login" />} 
          />
          <Route path="/" element={<Navigate to="/login" />} />
        </Routes>
      </Container>
    </Router>
  );
}

export default App;
